import React from "react";

const Show = ({name, image, symbol, price, volume}) => {
  return (
    <div>
    <img src={image} alt="cryptocurrency" /> <h1>{name}</h1> <p>{symbol}</p> <p>{price}</p>  <p>{volume}</p>
    </div>
  );
};

export default Show;
